import { Images } from '../Constants/images'
const Home = () => {
  const Styles = {
    BackgroundImage:`url(${Images.BG})`,
    BackgroundSize:'cover',
    BackgroundRepeat:'no-repeat'
  }
  return (
    <section className='h-[100vh] w-[100%]'>
        <div style={{Styles}}>
          
        </div>
    </section>
  )
}

export default Home
